import React from 'react';
import './App.css';
import {
  BrowserRouter as Router,
  Switch,
  Route,
  Link,
  useRouteMatch
} from 'react-router-dom';
/*
import {
  BrowserView,
  MobileView,
  isBrowser,
  isMobile
} from "react-device-detect"; 
*/

function App() {
  return (
    <div className="app">
        <Router>
            <div className="main">
                <Switch>
                    <Route path="/language">
                        <Navbar />
                        language
                    </Route>
                    <Route path="/aboutus">
                        <Navbar />
                        about us
                    </Route>
                    <Route path="/">
                        <Navbar />
                        home
                    </Route>
                </Switch>
            </div>
        </Router>
    </div>
  );
}

export default App;
